import React from 'react'
import {Container} from "react-bootstrap"

function App() {
  return (
    <Container 
      classNamer = "d-flex align-items-center justify-content-center"
      style = {{minHeight: "100vh"}}
    >
      <div className = "w-100" style = {{ maxWidth: "400px"}}></div>
      </Container>
  );
}

export default App;
